import uuid from 'uuid';
import {GET_RESOURCES} from '../actions/types';

const initialState = {

    resources:[
        {
            id: uuid(), name: "SJSU Food Pantry"
        },
        {
            id: uuid(), name: "Bowling room"
        }
    ]
    
}
